import { SearchList, Icon, Input } from "../../container/style";

const Searching = () => {
	const searching = (e: object) => {
		console.log("e", e);
	};
	return (
		<>
			<SearchList>
				<Input onChange={searching} />
				<Icon>search</Icon>
			</SearchList>
		</>
	);
};
export default Searching;
